import React from "react";


function MainVideo() {
    return (  
        <div className="mainVideo">
            <video src = "https://www.youtube.com/watch?v=brZRDjFIFJs" controls>
                <source src="https://www.youtube.com/watch?v=brZRDjFIFJs" type="video/mp4"/>
                <source src="https://www.youtube.com/watch?v=brZRDjFIFJs" type="video/com"/>
            </video>
        </div>
    );
}

export default MainVideo;
